import React from 'react'
import './topbar.css'
import '../common/common.css'

export default function topbar(){
    return (
        <div className='topbar'>
            <div className='titleWrap'>
                <div className='titleImg'></div>
                <div className='titleLg title-lg'>내 서재</div>
            </div>
        </div>

    )
}
